            INNER JOIN om_programa_academico_lista ON om_proyectos.programa_academico = om_programa_academico_lista.id_programa_academico
            INNER JOIN om_estado_proyecto ON om_proyectos.estado = om_estado_proyecto.id_estado 
             JOIN ( SELECT  id_proyecto, MAX(log_timestamp) AS ultima_fecha  FROM om_avances GROUP BY  id_proyecto )  AS ultimos_avances ON om_proyectos.id_proyecto = ultimos_avances.id_proyecto LEFT JOIN om_avances ON om_proyectos.id_proyecto = om_avances.id_proyecto AND ultimos_avances.ultima_fecha = om_avances.log_timestamp AND om_avances.tipo_documento = 3 WHERE om_proyectos.borrado = 0 ORDER BY om_proyectos.id_proyecto ASC
